import { Link } from 'react-router-dom';

const NotFound = () => {
  return (
    <div
      className='not-found h-full w-full'
      style="background-image: url('./img/NotFound.svg')"
    >
      <h2>Sorry</h2>
      <p>That page cannot be found</p>
      <Link to='/'>Back to the homepage...</Link>
    </div>
  );
};

export default NotFound;
